"""工具函数模块"""
import os
import sys
import base64
import tempfile

# 将 icon.ico 转换为 base64 字符串并嵌入
ICON_BASE64 = ""
  
# 临时图标文件路径（全局变量，避免重复创建）
_temp_icon_path = None


def get_embedded_icon_path():
    """从嵌入的 base64 数据中提取图标到临时文件"""
    global _temp_icon_path
    
    if _temp_icon_path and os.path.exists(_temp_icon_path):
        return _temp_icon_path
    
    if ICON_BASE64 is None:
        possible_paths = [
            os.path.join(os.path.dirname(os.path.abspath(__file__)), "icon.ico"),
            os.path.join(os.getcwd(), "icon.ico"),
        ]
        
        for icon_path in possible_paths:
            if os.path.exists(icon_path):
                try:
                    with open(icon_path, 'rb') as f:
                        icon_data = f.read()
                    icon_b64 = base64.b64encode(icon_data).decode('utf-8')
                    temp_file = tempfile.NamedTemporaryFile(delete=False, suffix='.ico')
                    temp_file.write(icon_data)
                    temp_file.close()
                    _temp_icon_path = temp_file.name
                    return _temp_icon_path
                except Exception:
                    continue
        return None
    
    try:
        icon_data = base64.b64decode(ICON_BASE64)
        temp_file = tempfile.NamedTemporaryFile(delete=False, suffix='.ico')
        temp_file.write(icon_data)
        temp_file.close()
        _temp_icon_path = temp_file.name
        return _temp_icon_path
    except Exception:
        return None


def get_icon_path():
    """获取图标文件路径，支持开发环境和打包后的环境"""
    # 优先使用嵌入的图标
    embedded_path = get_embedded_icon_path()
    if embedded_path:
        return embedded_path
    
    # 回退到文件系统查找（开发环境）
    possible_paths = []
    
    # 脚本所在目录（开发环境）
    script_dir = os.path.dirname(os.path.abspath(__file__))
    possible_paths.append(os.path.join(script_dir, "icon.ico"))
    
    # 当前工作目录
    possible_paths.append(os.path.join(os.getcwd(), "icon.ico"))
    
    # 按顺序检查每个路径
    for icon_path in possible_paths:
        if icon_path and os.path.exists(icon_path):
            return icon_path
    
    return None


def set_window_icon(window):
    """设置窗口图标"""
    try:
        icon_path = get_icon_path()
        if icon_path and os.path.exists(icon_path):
            window.iconbitmap(icon_path)
    except Exception:
        # 如果设置图标失败，忽略错误
        pass



